import React, { Component } from 'react';

class About extends Component {
    render() {
        return (
            <div>
                <div className = "card">
                    <div className ="card-action">
                        <h6><strong>THÔNG TIN CÁ NHÂN</strong></h6>
                        <div className = "row mt">
                            <div className="col s12 m6 16 x16">
                                <p><strong>Họ và tên: </strong>Võ Thanh Sơn</p>
                                <p><strong>Năm sinh: </strong>1999</p>
                                <p><strong>Địa chỉ: </strong>QuangNam</p>
                            </div>
                            <div className = "s12 m6 16 x16">
                            <p><strong>Email: </strong>voson0408@gmail.com</p>
                                <p><strong>Điện thoại: </strong>0346526102</p>       
                            <p><strong>Ngoại ngữ: </strong>Tiếng anh</p>
                            </div>
                         </div>
                    </div>
                </div>
            </div>
        );
    }
}

export default About;
